import React from 'react';

import classes from './NavigationItems.module.css';
import NavigationItem from './NavigationItem/NavigationItem';

const navigationItems = ( { handleGoogleLogin, handleGoogleLogout, handleGoogleFailure, currPlayer, setMode } ) => {
  if (currPlayer === null) {
    return (
      <div>
      <ul className={classes.NavigationItems}>
          <NavigationItem type="Home" setMode={setMode} active>Home</NavigationItem>
          <NavigationItem type="My Games" setMode={setMode}>My Games</NavigationItem>
          <NavigationItem type="Log in" setMode={setMode} func={handleGoogleLogin}>Log in</NavigationItem>
          {/* <NavigationItem link="/">Log out</NavigationItem> */}
      </ul>
      <GoogleLogin
        clientId={GOOGLE_CLIENT_ID}
        buttonText="Login with Google"
        isSignedIn
        onSuccess={handleGoogleLogin}
        onFailure={handleGoogleFailure}/>
      </div>


    );

  }

  return (
      <ul className={classes.NavigationItems}>
          <NavigationItem link="/" active>Home</NavigationItem>
          <NavigationItem link="/">My Games</NavigationItem>
          <NavigationItem link="/">Log out</NavigationItem>
      </ul>
  );



}

export default navigationItems;
